/**
* 
* options {}
* page: 
* pageNo, 
* pageSize, 
* pageCount, 
* pageTotal, 
* callback, 
* */
function Page(options){
this.page = $(options.page);
this.pageNo = 1;
this.pageSize = 0;
this.pageCount = 0;
this.pageTotal = 0;
this.callback = options.callback;
this.init();
}

Page.prototype = {
constructor: Page,

init: function(){
var self = this,
page = this.page;
$('a',page).live('click',function(e){
var t = $(this),
className = t.attr('class').replace('icons ','');
switch(className){
case 'icon-page-next':
self.pageNo++;
break;
case 'icon-page-prev':
self.pageNo--;
break;
case 'icon-page-first':
self.pageNo = 1;
break;
case 'icon-page-last':
self.pageNo = self.pageCount;
break;
}
self.jump();
return false;
});

$(':text',page).live('keyup',function(e){
var t = $(this),
value = t.val();
if(/^[0-9]+$/.test(value)){
self.pageNo = value;
}else{
t.val('');
}

if(e.keyCode == 13){
self.jump();
}
});
},

/*
* 
* */
update: function(options){
for(var i in options){
this[i] = options[i];
}
var html = '', pageCount = this.pageCount;
if(this.pageTotal == 0 || pageCount == 1){
html = '<i class="icons icon-page-first"></i>'
+'<i class="icons icon-page-prev"></i>'
+'<span class="page-textarea">'
+'<input type="text" class="text" value="1" title="" /> /<span class="page-count">1</span>'
+'</span>'
+'<i class="icons icon-page-next"></i>'
+'<i class="icons icon-page-last"></i>';
}else if(this.pageNo == 1){
html = '<i class="icons icon-page-first"></i>'
+'<i class="icons icon-page-prev"></i>'
+'<span class="page-textarea">'
+'<input type="text" class="text" value="1" title="" /> /<span class="page-count">'+ pageCount +'</span>'
+'</span>'
+'<a href="#" class="icons icon-page-next" title=""></a>'
+'<a href="#" class="icons icon-page-last" title=""></a>';
}else if(this.pageNo == pageCount){
html = '<a href="#" class="icons icon-page-first" title=""></a>'
+'<a href="#" class="icons icon-page-prev" title=""></a>'
+'<span class="page-textarea">'
+'<input type="text" class="text" value="'+ pageCount +'" title="" /> /<span class="page-count">'+ pageCount +'</span>'
+'</span>'
+'<i class="icons icon-page-next"></i>'
+'<i class="icons icon-page-last"></i>';
}else{
html = '<a href="#" class="icons icon-page-first" title=""></a>'
+'<a href="#" class="icons icon-page-prev" title=""></a>'
+'<span class="page-textarea">'
+'<input type="text" class="text" value="'+ this.pageNo +'" title="" /> /<span class="page-count">'+ pageCount +'</span>'
+'</span>'
+'<a href="#" class="icons icon-page-next" title=""></a>'
+'<a href="#" class="icons icon-page-last" title=""></a>';
}
this.page.html(html);
},

jump: function(){
if(this.pageNo > this.pageCount) this.pageNo = this.pageCount;
else if(this.pageNo < 1) this.pageNo = 1;

this.callback({ pageNo: this.pageNo});
},

getCurrentPageNo: function(){
return this.pageNo;
}
};
